import{_ as n,c as s,o as a,a as e}from"./app.14440598.js";const h=`{"title":"v4.0.33 Release Notes","description":"","frontmatter":{"title":"v4.0.33 Release Notes","slug":"v4-0-33"},"headers":[{"level":2,"title":"OrmLite now supports Async!","slug":"ormlite-now-supports-async"},{"level":3,"title":"Async RDBMS Providers","slug":"async-rdbms-providers"},{"level":3,"title":"Multiple Self References","slug":"multiple-self-references"},{"level":2,"title":"ServiceStack.Redis SSL Support","slug":"servicestack-redis-ssl-support"},{"level":3,"title":"Redis Use Cases","slug":"redis-use-cases"},{"level":3,"title":"Connecting to Azure Redis","slug":"connecting-to-azure-redis"},{"level":3,"title":"Redis Connection Strings","slug":"redis-connection-strings"},{"level":3,"title":"New RedisManagerPool Client Manager","slug":"new-redismanagerpool-client-manager"},{"level":3,"title":"New Generic API's for calling Custom Redis commands","slug":"new-generic-api-s-for-calling-custom-redis-commands"},{"level":3,"title":"New Config, Role and Client commands","slug":"new-config-role-and-client-commands"},{"level":2,"title":"New VB.NET Add ServiceStack Reference!","slug":"new-vb-net-add-servicestack-reference"},{"level":3,"title":"Upgrade ServiceStackVS","slug":"upgrade-servicestackvs"},{"level":2,"title":"Simplified UX for all languages","slug":"simplified-ux-for-all-languages"},{"level":3,"title":"Improving Single Generated Source File Story","slug":"improving-single-generated-source-file-story"},{"level":3,"title":"Update ServiceStack Reference Context Menu Item","slug":"update-servicestack-reference-context-menu-item"},{"level":3,"title":"Updating and Customizing Generated Types","slug":"updating-and-customizing-generated-types"},{"level":3,"title":"ServiceStack.Text","slug":"servicestack-text"},{"level":2,"title":"RabbitMQ","slug":"rabbitmq"},{"level":2,"title":"Other Minor Changes","slug":"other-minor-changes"},{"level":2,"title":"Breaking changes","slug":"breaking-changes"},{"level":3,"title":"Added new .NET 4.5 Builds","slug":"added-new-net-4-5-builds"},{"level":3,"title":"Removed ThreadStatic OrmLite Configuration","slug":"removed-threadstatic-ormlite-configuration"},{"level":3,"title":"IReturnVoid now returns void","slug":"ireturnvoid-now-returns-void"}],"relativePath":"releases/v4.0.33.md","lastUpdated":1634495308430}`,t={},o=e(`<h2 id="ormlite-now-supports-async" tabindex="-1">OrmLite now supports Async! <a class="header-anchor" href="#ormlite-now-supports-async" aria-hidden="true">#</a></h2><p>Another <a href="http://servicestack.uservoice.com/forums/176786-feature-requests/suggestions/6217167-provider-async-support-for-ormlite" target="_blank" rel="noopener noreferrer">major feature request</a> is ticked off in this release with the new <strong>Async support available in OrmLite!</strong></p><p>A quick overview of the new Async API&#39;s added can be seen in the class diagram below:</p><p><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/ormlite/OrmLiteApiAsync.png" alt="OrmLite Async APIs"></p><p>Basically most of OrmLite public API&#39;s now have async equivalents of the same name and an additional conventional <code>*Async</code> suffix. The Async API&#39;s also take an optional <code>CancellationToken</code> making converting sync code trivial, where you just need to add the <code>Async</code> suffix and <strong>await</strong> keyword, as can be seen in the <a href="https://github.com/ServiceStack/ServiceStack.OrmLite/commit/c1ce6f0eac99133fc232b263c26c42379d4c5f48" target="_blank" rel="noopener noreferrer">Customer Orders UseCase upgrade to Async diff</a> , e.g:</p><p>Sync:</p><div class="language-csharp"><pre><code>db<span class="token punctuation">.</span><span class="token function">Insert</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Employee</span> <span class="token punctuation">{</span> Id <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">,</span> Name <span class="token operator">=</span> <span class="token string">&quot;Employee 1&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
db<span class="token punctuation">.</span><span class="token function">Save</span><span class="token punctuation">(</span>product1<span class="token punctuation">,</span> product2<span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token class-name"><span class="token keyword">var</span></span> customer <span class="token operator">=</span> db<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Single</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Customer<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token punctuation">{</span> customer<span class="token punctuation">.</span>Email <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span> 
</code></pre></div><p>Async:</p><div class="language-csharp"><pre><code><span class="token keyword">await</span> db<span class="token punctuation">.</span><span class="token function">InsertAsync</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Employee</span> <span class="token punctuation">{</span> Id <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">,</span> Name <span class="token operator">=</span> <span class="token string">&quot;Employee 1&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token keyword">await</span> db<span class="token punctuation">.</span><span class="token function">SaveAsync</span><span class="token punctuation">(</span>product1<span class="token punctuation">,</span> product2<span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token class-name"><span class="token keyword">var</span></span> customer <span class="token operator">=</span> <span class="token keyword">await</span> db<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">SingleAsync</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Customer<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token punctuation">{</span> customer<span class="token punctuation">.</span>Email <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><blockquote><p>Effectively the only Data Access API&#39;s that doesn&#39;t have async equivalents are <code>*Lazy</code> APIs yielding a lazy sequence (incompatible with async) as well as <strong>Schema</strong> DDL API&#39;s which are typically not used at runtime.</p></blockquote><p>For a quick preview of many of the new Async API&#39;s in action, checkout <a href="https://github.com/ServiceStack/ServiceStack.OrmLite/blob/master/tests/ServiceStack.OrmLiteV45.Tests/ApiSqlServerTestsAsync.cs" target="_blank" rel="noopener noreferrer">ApiSqlServerTestsAsync.cs</a>.</p><h3 id="async-rdbms-providers" tabindex="-1">Async RDBMS Providers <a class="header-anchor" href="#async-rdbms-providers" aria-hidden="true">#</a></h3><p>Currently only a limited number of RDBMS providers offer async API&#39;s which are only available in their <strong>.NET 4.5</strong> builds, which at this time are only:</p><ul><li><a href="https://www.nuget.org/packages/ServiceStack.OrmLite.SqlServer" target="_blank" rel="noopener noreferrer">SQL Server .NET 4.5+</a></li><li><a href="https://www.nuget.org/packages/ServiceStack.OrmLite.MySql" target="_blank" rel="noopener noreferrer">MySQL .NET 4.5+</a></li></ul><p>We&#39;ve also added a <a href="https://www.nuget.org/packages/ServiceStack.OrmLite.Sqlite.Mono" target="_blank" rel="noopener noreferrer">.NET 4.5 build for Sqlite</a> as it&#39;s a common use-case to swapout to use Sqlite&#39;s in-memory provider for faster tests. But as Sqlite doesn&#39;t provide async API&#39;s under-the-hood we fallback to <em>pseudo async</em> support where we just wrap its synchronous responses in <code>Task</code> results.</p><p>Regardless of whether the RDBMS provider offers Async API&#39;s, you still can use the same OrmLite async API&#39;s with all providers, where the same Async OrmLite API&#39;s can also be used in DB Providers that doesn&#39;t natively support Async (i.e. Sqlite):</p><ul><li><a href="https://github.com/ServiceStack/ServiceStack.OrmLite/blob/master/tests/ServiceStack.OrmLiteV45.Tests/ApiSqlServerTestsAsync.cs" target="_blank" rel="noopener noreferrer">ApiSqlServerTestsAsync.cs</a></li><li><a href="https://github.com/ServiceStack/ServiceStack.OrmLite/blob/master/tests/ServiceStack.OrmLiteV45.Tests/ApiMySqlTestsAsync.cs" target="_blank" rel="noopener noreferrer">ApiMySqlTestsAsync.cs</a></li><li><a href="https://github.com/ServiceStack/ServiceStack.OrmLite/blob/master/tests/ServiceStack.OrmLiteV45.Tests/ApiSqliteTestsAsync.cs" target="_blank" rel="noopener noreferrer">ApiSqliteTestsAsync.cs</a></li></ul><p>Only when these Async API&#39;s are run on an RDBMS provider with native async support (i.e. .NET 4.5 SqlServer or MySql) will you benefit from true non-blocking Async I/O, otherwise it fallsback to <em>pseudo async</em> support, i.e. synchronous I/O datasets wrapped in <code>Task</code> Results.</p><h3 id="multiple-self-references" tabindex="-1">Multiple Self References <a class="header-anchor" href="#multiple-self-references" aria-hidden="true">#</a></h3><p>OrmLite&#39;s <a href="https://github.com/ServiceStack/ServiceStack.OrmLite#reference-conventions" target="_blank" rel="noopener noreferrer">POCO Reference conventions</a> has been expanded to include support for multiple Self References.</p><p>The example below shows a customer with multiple <code>CustomerAddress</code> references which are able to be matched with the <code>{PropertyReference}Id</code> naming convention, e.g:</p><div class="language-csharp"><pre><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">Customer</span>
<span class="token punctuation">{</span>
    <span class="token punctuation">[</span><span class="token attribute"><span class="token class-name">AutoIncrement</span></span><span class="token punctuation">]</span>
    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">int</span></span> Id <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>
    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">string</span></span> Name <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>

    <span class="token punctuation">[</span><span class="token attribute"><span class="token class-name">References</span><span class="token attribute-arguments"><span class="token punctuation">(</span><span class="token keyword">typeof</span><span class="token punctuation">(</span><span class="token type-expression class-name">CustomerAddress</span><span class="token punctuation">)</span><span class="token punctuation">)</span></span></span><span class="token punctuation">]</span>
    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">int</span><span class="token punctuation">?</span></span> HomeAddressId <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>

    <span class="token punctuation">[</span><span class="token attribute"><span class="token class-name">References</span><span class="token attribute-arguments"><span class="token punctuation">(</span><span class="token keyword">typeof</span><span class="token punctuation">(</span><span class="token type-expression class-name">CustomerAddress</span><span class="token punctuation">)</span><span class="token punctuation">)</span></span></span><span class="token punctuation">]</span>
    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">int</span><span class="token punctuation">?</span></span> WorkAddressId <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>

    <span class="token punctuation">[</span><span class="token attribute"><span class="token class-name">Reference</span></span><span class="token punctuation">]</span>
    <span class="token keyword">public</span> <span class="token return-type class-name">CustomerAddress</span> HomeAddress <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>

    <span class="token punctuation">[</span><span class="token attribute"><span class="token class-name">Reference</span></span><span class="token punctuation">]</span>
    <span class="token keyword">public</span> <span class="token return-type class-name">CustomerAddress</span> WorkAddress <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre></div><p>Once defined, it can be saved and loaded via OrmLite&#39;s normal Reference and Select API&#39;s, e.g:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> customer <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">Customer</span>
<span class="token punctuation">{</span>
    Name <span class="token operator">=</span> <span class="token string">&quot;Z Customer&quot;</span><span class="token punctuation">,</span>
    HomeAddress <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">CustomerAddress</span> <span class="token punctuation">{</span>
        Address <span class="token operator">=</span> <span class="token string">&quot;1 Home Street&quot;</span><span class="token punctuation">,</span>
        Country <span class="token operator">=</span> <span class="token string">&quot;US&quot;</span>
    <span class="token punctuation">}</span><span class="token punctuation">,</span>
    WorkAddress <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">CustomerAddress</span> <span class="token punctuation">{</span>
        Address <span class="token operator">=</span> <span class="token string">&quot;2 Work Road&quot;</span><span class="token punctuation">,</span>
        Country <span class="token operator">=</span> <span class="token string">&quot;UK&quot;</span>
    <span class="token punctuation">}</span><span class="token punctuation">,</span>
<span class="token punctuation">}</span><span class="token punctuation">;</span>

db<span class="token punctuation">.</span><span class="token function">Save</span><span class="token punctuation">(</span>customer<span class="token punctuation">,</span> <span class="token named-parameter punctuation">references</span><span class="token punctuation">:</span><span class="token boolean">true</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

<span class="token class-name"><span class="token keyword">var</span></span> c <span class="token operator">=</span> db<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">LoadSelect</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Customer<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>q <span class="token operator">=&gt;</span> q<span class="token punctuation">.</span>Name <span class="token operator">==</span> <span class="token string">&quot;Z Customer&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
c<span class="token punctuation">.</span>WorkAddress<span class="token punctuation">.</span>Address<span class="token punctuation">.</span><span class="token function">Print</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// 2 Work Road</span>

<span class="token class-name"><span class="token keyword">var</span></span> ukAddress <span class="token operator">=</span> db<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Single</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>CustomerAddress<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>q <span class="token operator">=&gt;</span> q<span class="token punctuation">.</span>Country <span class="token operator">==</span> <span class="token string">&quot;UK&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
ukAddress<span class="token punctuation">.</span>Address<span class="token punctuation">.</span><span class="token function">Print</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>     <span class="token comment">// 2 Work Road</span>
</code></pre></div><h2 id="servicestack-redis-ssl-support" tabindex="-1"><a href="/ssl-redis-azure.html">ServiceStack.Redis SSL Support</a> <a class="header-anchor" href="#servicestack-redis-ssl-support" aria-hidden="true">#</a></h2><p>The <a href="http://servicestack.uservoice.com/forums/176786-feature-requests/suggestions/6093693-support-ssl-connection-to-redis-instances-hosted-a" target="_blank" rel="noopener noreferrer">most requested feature for ServiceStack.Redis</a> has also been realized in this release with <strong>ServiceStack.Redis</strong> now supporting <strong>SSL connections</strong> making it suitable for accessing remote Redis server instances over a <strong>secure SSL connection</strong>.</p><p><img src="https://github.com/ServiceStack/Assets/raw/master/img/wikis/redis/azure-redis-instance.png" alt="Azure Redis Cache"></p><h3 id="redis-use-cases" tabindex="-1">Redis Use Cases <a class="header-anchor" href="#redis-use-cases" aria-hidden="true">#</a></h3><p>Redis is normally used as a back-end datastore whose access is typically limited to Internal networks or authorized networks protected via firewalls. The new SSL Support in the Redis Client also enables secure access to a redis-server instance over the Internet and public networks as well, a scenario that&#39;s been recently popularized by Cloud hosting environments like Azure Redis Cache.</p><h3 id="connecting-to-azure-redis" tabindex="-1"><a href="/ssl-redis-azure.html">Connecting to Azure Redis</a> <a class="header-anchor" href="#connecting-to-azure-redis" aria-hidden="true">#</a></h3><p>As connecting to <a href="http://azure.microsoft.com/en-us/services/cache/" target="_blank" rel="noopener noreferrer">Azure Redis Cache</a> via SSL was the primary use-case for this feature, we&#39;ve added a new <a href="/ssl-redis-azure.html">Getting connected to Azure Redis via SSL</a> to help you get started.</p><h3 id="redis-connection-strings" tabindex="-1">Redis Connection Strings <a class="header-anchor" href="#redis-connection-strings" aria-hidden="true">#</a></h3><p>Redis Connection strings have been expanded to support the more versatile URI format which is now able to capture most of Redis Client settings in a single connection string (akin to DB Connection strings).</p><p>Redis Connection Strings supports multiple URI-like formats, from a simple <strong>hostname</strong> or <strong>IP Address and port</strong> pair to a fully-qualified <strong>URL</strong> with multiple options specified on the QueryString.</p><p>Some examples of supported formats:</p><pre><code>localhost
127.0.0.1:6379
redis://localhost:6379
password@localhost:6379
clientid:password@localhost:6379
redis://clientid:password@localhost:6380?ssl=true&amp;db=1
</code></pre><blockquote><p>More examples can be seen in <a href="https://github.com/ServiceStack/ServiceStack.Redis/blob/master/tests/ServiceStack.Redis.Tests/ConfigTests.cs" target="_blank" rel="noopener noreferrer">ConfigTests.cs</a></p></blockquote><p>Any additional configuration can be specified as QueryString parameters. The full list of options that can be specified include:</p><table class="table"><tr><td><b>Ssl</b></td><td>bool</td><td>If this is an SSL connection</td></tr><tr><td><b>Db</b></td><td>int</td><td>The Redis DB this connection should be set to</td></tr><tr><td><b>Client</b></td><td>string</td><td>A text alias to specify for this connection for analytic purposes</td></tr><tr><td><b>Password</b></td><td>string</td><td>UrlEncoded version of the Password for this connection</td></tr><tr><td><b>ConnectTimeout</b></td><td>int</td><td>Timeout in ms for making a TCP Socket connection</td></tr><tr><td><b>SendTimeout</b></td><td>int</td><td>Timeout in ms for making a synchronous TCP Socket Send</td></tr><tr><td><b>ReceiveTimeout</b></td><td>int</td><td>Timeout in ms for waiting for a synchronous TCP Socket Receive</td></tr><tr><td><b>IdleTimeOutSecs</b></td><td>int</td><td>Timeout in Seconds for an Idle connection to be considered active</td></tr><tr><td><b>NamespacePrefix</b></td><td>string</td><td>Use a custom prefix for ServiceStack.Redis internal index colletions</td></tr></table><h3 id="new-redismanagerpool-client-manager" tabindex="-1">New <code>RedisManagerPool</code> Client Manager <a class="header-anchor" href="#new-redismanagerpool-client-manager" aria-hidden="true">#</a></h3><p>With the introduction of Redis URI Connection Strings we&#39;ve been able to simplify and streamline the existing <code>PooledRedisClientManager</code> implementation that&#39;s been extracted out into clients manager called <code>RedisManagerPool</code>. In addition to removing all above options on the Client Manager itself, we&#39;ve also removed readonly connection strings so the configuration is much simpler and more aligned with the common use-case.</p><p>In most cases, <code>PooledRedisClientManager</code> is substitutable with <code>RedisManagerPool</code> e.g:</p><div class="language-csharp"><pre><code>container<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Register</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>IRedisClientsManager<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>c <span class="token operator">=&gt;</span> 
    <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RedisManagerPool</span><span class="token punctuation">(</span>redisConnectionString<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><h3 id="new-generic-api-s-for-calling-custom-redis-commands" tabindex="-1">New Generic API&#39;s for calling Custom Redis commands <a class="header-anchor" href="#new-generic-api-s-for-calling-custom-redis-commands" aria-hidden="true">#</a></h3><p>Most of the time when waiting to use a new <a href="http://redis.io/commands" target="_blank" rel="noopener noreferrer">Redis Command</a> you&#39;ll need to wait for an updated version of <strong>ServiceStack.Redis</strong> to add support for the new commands likewise there are times when the Redis Client doesn&#39;t offer every permutation that redis-server supports.</p><p>With the new <code>Custom</code> and <code>RawCommand</code> API&#39;s on <code>IRedisClient</code> and <code>IRedisNativeClient</code> you can now use the RedisClient to send your own custom commands that can call adhoc Redis commands:</p><div class="language-csharp"><pre><code><span class="token keyword">public</span> <span class="token keyword">interface</span> <span class="token class-name">IRedisClient</span>
<span class="token punctuation">{</span>
    <span class="token range operator">..</span><span class="token punctuation">.</span>
    <span class="token return-type class-name">RedisText</span> <span class="token function">Custom</span><span class="token punctuation">(</span><span class="token keyword">params</span> <span class="token class-name"><span class="token keyword">object</span><span class="token punctuation">[</span><span class="token punctuation">]</span></span> cmdWithArgs<span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>

<span class="token keyword">public</span> <span class="token keyword">interface</span> <span class="token class-name">IRedisNativeClient</span>
<span class="token punctuation">{</span>
    <span class="token range operator">..</span><span class="token punctuation">.</span>
    <span class="token return-type class-name">RedisData</span> <span class="token function">RawCommand</span><span class="token punctuation">(</span><span class="token keyword">params</span> <span class="token class-name"><span class="token keyword">object</span><span class="token punctuation">[</span><span class="token punctuation">]</span></span> cmdWithArgs<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name">RedisData</span> <span class="token function">RawCommand</span><span class="token punctuation">(</span><span class="token keyword">params</span> <span class="token class-name"><span class="token keyword">byte</span><span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">[</span><span class="token punctuation">]</span></span> cmdWithBinaryArgs<span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre></div><p>These API&#39;s return Custom Results in the generic data structures below:</p><div class="language-csharp"><pre><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">RedisText</span>
<span class="token punctuation">{</span>
    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">string</span></span> Text <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>
    <span class="token keyword">public</span> <span class="token return-type class-name">List<span class="token punctuation">&lt;</span>RedisText<span class="token punctuation">&gt;</span></span> Children <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>
<span class="token punctuation">}</span>

<span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">RedisData</span>
<span class="token punctuation">{</span>
    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">byte</span><span class="token punctuation">[</span><span class="token punctuation">]</span></span> Data <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>
    <span class="token keyword">public</span> <span class="token return-type class-name">List<span class="token punctuation">&lt;</span>RedisData<span class="token punctuation">&gt;</span></span> Children <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span> 
<span class="token punctuation">}</span>
</code></pre></div><p>These Custom API&#39;s take a flexible <code>object[]</code> arguments which accepts any serializable value e.g. <code>byte[]</code>, <code>string</code>, <code>int</code> as well as any user-defined Complex Types which are transparently serialized as JSON and send across the wire as UTF-8 bytes.</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> ret <span class="token operator">=</span> Redis<span class="token punctuation">.</span><span class="token function">Custom</span><span class="token punctuation">(</span><span class="token string">&quot;SET&quot;</span><span class="token punctuation">,</span> <span class="token string">&quot;foo&quot;</span><span class="token punctuation">,</span> <span class="token number">1</span><span class="token punctuation">)</span><span class="token punctuation">;</span>          <span class="token comment">// ret.Text = &quot;OK&quot;</span>

<span class="token class-name"><span class="token keyword">byte</span><span class="token punctuation">[</span><span class="token punctuation">]</span></span> cmdSet <span class="token operator">=</span> Commands<span class="token punctuation">.</span>Set<span class="token punctuation">;</span>
ret <span class="token operator">=</span> Redis<span class="token punctuation">.</span><span class="token function">Custom</span><span class="token punctuation">(</span>cmdSet<span class="token punctuation">,</span> <span class="token string">&quot;bar&quot;</span><span class="token punctuation">,</span> <span class="token string">&quot;b&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>           <span class="token comment">// ret.Text = &quot;OK&quot;</span>

ret <span class="token operator">=</span> Redis<span class="token punctuation">.</span><span class="token function">Custom</span><span class="token punctuation">(</span><span class="token string">&quot;GET&quot;</span><span class="token punctuation">,</span> <span class="token string">&quot;foo&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>                 <span class="token comment">// ret.Text = &quot;1&quot;</span>
</code></pre></div><p>There are also <a href="https://github.com/ServiceStack/ServiceStack.Redis/blob/master/src/ServiceStack.Redis/RedisDataExtensions.cs" target="_blank" rel="noopener noreferrer">convenient extension methods</a> on <code>RedisData</code> and <code>RedisText</code> that make it easy to access structured data, e.g:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> ret <span class="token operator">=</span> Redis<span class="token punctuation">.</span><span class="token function">Custom</span><span class="token punctuation">(</span>Commands<span class="token punctuation">.</span>Keys<span class="token punctuation">,</span> <span class="token string">&quot;*&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token class-name"><span class="token keyword">var</span></span> keys <span class="token operator">=</span> ret<span class="token punctuation">.</span><span class="token function">GetResults</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>                      <span class="token comment">// keys = [&quot;foo&quot;, &quot;bar&quot;]</span>

ret <span class="token operator">=</span> Redis<span class="token punctuation">.</span><span class="token function">Custom</span><span class="token punctuation">(</span>Commands<span class="token punctuation">.</span>MGet<span class="token punctuation">,</span> <span class="token string">&quot;foo&quot;</span><span class="token punctuation">,</span> <span class="token string">&quot;bar&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token class-name"><span class="token keyword">var</span></span> values <span class="token operator">=</span> ret<span class="token punctuation">.</span><span class="token function">GetResults</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>                    <span class="token comment">// values = [&quot;1&quot;, &quot;b&quot;]</span>

Enum<span class="token punctuation">.</span><span class="token function">GetNames</span><span class="token punctuation">(</span><span class="token keyword">typeof</span><span class="token punctuation">(</span><span class="token type-expression class-name">DayOfWeek</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">ToList</span><span class="token punctuation">(</span><span class="token punctuation">)</span>
    <span class="token punctuation">.</span><span class="token function">ForEach</span><span class="token punctuation">(</span>x <span class="token operator">=&gt;</span> Redis<span class="token punctuation">.</span><span class="token function">Custom</span><span class="token punctuation">(</span>Commands<span class="token punctuation">.</span>RPush<span class="token punctuation">,</span> <span class="token string">&quot;DaysOfWeek&quot;</span><span class="token punctuation">,</span> x<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
ret <span class="token operator">=</span> Redis<span class="token punctuation">.</span><span class="token function">Custom</span><span class="token punctuation">(</span>Commands<span class="token punctuation">.</span>LRange<span class="token punctuation">,</span> <span class="token string">&quot;DaysOfWeek&quot;</span><span class="token punctuation">,</span> <span class="token number">1</span><span class="token punctuation">,</span> <span class="token operator">-</span><span class="token number">2</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token class-name"><span class="token keyword">var</span></span> weekDays <span class="token operator">=</span> ret<span class="token punctuation">.</span><span class="token function">GetResults</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>      

weekDays<span class="token punctuation">.</span><span class="token function">PrintDump</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// [&quot;Monday&quot;, &quot;Tuesday&quot;, &quot;Wednesday&quot;, &quot;Thursday&quot;, &quot;Friday&quot;]</span>
</code></pre></div><p>and some more examples using Complex Types with the Custom API&#39;s:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> ret <span class="token operator">=</span> Redis<span class="token punctuation">.</span><span class="token function">Custom</span><span class="token punctuation">(</span>Commands<span class="token punctuation">.</span>Set<span class="token punctuation">,</span> <span class="token string">&quot;foo&quot;</span><span class="token punctuation">,</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">Poco</span> <span class="token punctuation">{</span> Name <span class="token operator">=</span> <span class="token string">&quot;Bar&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// ret.Text = &quot;OK&quot;</span>

ret <span class="token operator">=</span> Redis<span class="token punctuation">.</span><span class="token function">Custom</span><span class="token punctuation">(</span>Commands<span class="token punctuation">.</span>Get<span class="token punctuation">,</span> <span class="token string">&quot;foo&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>          <span class="token comment">// ret.Text =  {&quot;Name&quot;:&quot;Bar&quot;}</span>
<span class="token class-name">Poco</span> dto <span class="token operator">=</span> ret<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">GetResult</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Poco<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

dto<span class="token punctuation">.</span>Name<span class="token punctuation">.</span><span class="token function">Print</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// Bar</span>
</code></pre></div><h3 id="new-config-role-and-client-commands" tabindex="-1">New Config, Role and Client commands <a class="header-anchor" href="#new-config-role-and-client-commands" aria-hidden="true">#</a></h3><p>A number of New API&#39;s added in this can be seen below:</p><div class="language-csharp"><pre><code><span class="token keyword">public</span> <span class="token keyword">interface</span> <span class="token class-name">IRedisClient</span>
<span class="token punctuation">{</span>
    <span class="token range operator">..</span><span class="token punctuation">.</span>
    <span class="token return-type class-name">RedisText</span> <span class="token function">GetServerRoleInfo</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">string</span></span> <span class="token function">GetConfig</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">string</span></span> item<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">SetConfig</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">string</span></span> item<span class="token punctuation">,</span> <span class="token class-name"><span class="token keyword">string</span></span> <span class="token keyword">value</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">SaveConfig</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">ResetInfoStats</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

    <span class="token return-type class-name"><span class="token keyword">string</span></span> <span class="token function">GetClient</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">SetClient</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">string</span></span> name<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">KillClient</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">string</span></span> address<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">long</span></span> <span class="token function">KillClients</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">string</span></span> fromAddress <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">,</span> 
        <span class="token class-name"><span class="token keyword">string</span></span> withId <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">,</span> <span class="token class-name">RedisClientType<span class="token punctuation">?</span></span> ofType <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">,</span> <span class="token class-name"><span class="token keyword">bool</span><span class="token punctuation">?</span></span> skipMe <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name">List<span class="token punctuation">&lt;</span>Dictionary<span class="token punctuation">&lt;</span><span class="token keyword">string</span><span class="token punctuation">,</span> <span class="token keyword">string</span><span class="token punctuation">&gt;</span><span class="token punctuation">&gt;</span></span> <span class="token function">GetClientsInfo</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">PauseAllClients</span><span class="token punctuation">(</span><span class="token class-name">TimeSpan</span> duration<span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>

<span class="token keyword">public</span> <span class="token keyword">interface</span> <span class="token class-name">IRedisNativeClient</span>
<span class="token punctuation">{</span>
    <span class="token range operator">..</span><span class="token punctuation">.</span>
    <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">ConfigRewrite</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name">RedisText</span> <span class="token function">Role</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">string</span></span> <span class="token function">ClientGetName</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">ClientSetName</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">string</span></span> client<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">ClientKill</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">string</span></span> host<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">long</span></span> <span class="token function">ClientKill</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">string</span></span> addr <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">,</span> <span class="token class-name"><span class="token keyword">string</span></span> id <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">,</span> <span class="token class-name"><span class="token keyword">string</span></span> type <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">,</span> <span class="token class-name"><span class="token keyword">string</span></span> skipMe <span class="token operator">=</span> <span class="token keyword">null</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">byte</span><span class="token punctuation">[</span><span class="token punctuation">]</span></span> <span class="token function">ClientList</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">ClientPause</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">int</span></span> timeOutMs<span class="token punctuation">)</span><span class="token punctuation">;</span>    
<span class="token punctuation">}</span>
</code></pre></div><h2 id="new-vb-net-add-servicestack-reference" tabindex="-1"><a href="/vbnet-add-servicestack-reference.html">New VB.NET Add ServiceStack Reference!</a> <a class="header-anchor" href="#new-vb-net-add-servicestack-reference" aria-hidden="true">#</a></h2><p>This release also adds <a href="/add-servicestack-reference.html">Add ServiceStack Reference</a> support for the last remaining major .NET language with the new first-class support for <a href="/vbnet-add-servicestack-reference.html">VB.NET Add ServiceStack Reference</a>!</p><p>This now allows any C#, F# or <a href="http://VB.NET" target="_blank" rel="noopener noreferrer">VB.NET</a> client project to be able generate and end-to-end typed API for your services just by providing the url of your remote ServiceStack instance, directly from within <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a>!</p><p><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/apps/StackApis/add-service-ref-flow.png" alt="Add ServiceStack Reference"></p><p>After clicking OK, the servers DTO&#39;s and <strong>ServiceStack.Client</strong> NuGet package are added to the project, providing an instant typed API:</p><p><img src="https://github.com/ServiceStack/Assets/raw/master/img/apps/StackApis/call-service-vb.png" alt="Calling a ServiceStack Service from VB.NET"></p><p>Thanks to the close semantics between the C# and <a href="http://VB.NET" target="_blank" rel="noopener noreferrer">VB.NET</a> languages, we&#39;re able to add support for all C# <a href="/vbnet-add-servicestack-reference.html#dto-customization-options">customization options in VB.NET</a> as well.</p><p>Much of the new <a href="http://VB.NET" target="_blank" rel="noopener noreferrer">VB.NET</a> NativeTypes provider is thanks to the efforts of <a href="https://github.com/KevinHoward" target="_blank" rel="noopener noreferrer">@KevinHoward</a>.</p><h3 id="upgrade-servicestackvs" tabindex="-1"><a href="/create-your-first-webservice.html">Upgrade ServiceStackVS</a> <a class="header-anchor" href="#upgrade-servicestackvs" aria-hidden="true">#</a></h3><p>To take advantage of <a href="http://VB.NET" target="_blank" rel="noopener noreferrer">VB.NET</a> Add ServiceStack Reference feature, <a href="/create-your-first-webservice.html">Upgrade or Install ServiceStackVS</a> <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> Extension. If you already have <strong>ServiceStackVS</strong> installed, uninstall it first from <code>Tools -&gt; Extensions and Updates... -&gt; ServiceStackVS -&gt; Uninstall</code>.</p><h2 id="simplified-ux-for-all-languages" tabindex="-1">Simplified UX for all languages <a class="header-anchor" href="#simplified-ux-for-all-languages" aria-hidden="true">#</a></h2><p>Our first iteration of <strong>Add ServiceStack Reference</strong> for C# used a <strong>T4 Template</strong> to make it easy for clients to view and modify all Customization options available and to be able to auto-generate the Server DTO&#39;s by modifying and saving (or re-running) the T4 template.</p><p>As F# projects didn&#39;t support T4 Templates, when we added support for <a href="/fsharp-add-servicestack-reference.html">F# Add ServiceStack Reference</a> we had to skip the T4 template and add the server-generated DTO&#39;s source file directly to the project.</p><p>By skipping the T4 Template we pleasantly discovered we ended up with a nicer, simplified and more user-friendly UX, with less moving parts for the default use case of generating client DTO&#39;s based on the <a href="/csharp-add-servicestack-reference.html#change-default-server-configuration">Default Server Configuration</a>.</p><h3 id="improving-single-generated-source-file-story" tabindex="-1">Improving Single Generated Source File Story <a class="header-anchor" href="#improving-single-generated-source-file-story" aria-hidden="true">#</a></h3><p>We&#39;ve since decided to embrace and provide a better development experience around a single source file approach and use it consistently in all C#, F# and <a href="http://VB.NET" target="_blank" rel="noopener noreferrer">VB.NET</a> projects - now resulting simpler <strong>Add ServiceStack Reference</strong> UX for all client projects.</p><h3 id="update-servicestack-reference-context-menu-item" tabindex="-1">Update ServiceStack Reference Context Menu Item <a class="header-anchor" href="#update-servicestack-reference-context-menu-item" aria-hidden="true">#</a></h3><p>With the latest <strong>ServiceStackVS</strong> you can now update the Server DTO&#39;s in all projects by clicking on <code>Update ServiceStack Reference</code> on the context-menu, e.g:</p><p><img src="https://github.com/ServiceStack/Assets/raw/master/img/servicestackvs/servicestack%20reference/updateref-vbnet.gif" alt="Update ServiceStack Reference"></p><h3 id="updating-and-customizing-generated-types" tabindex="-1">Updating and Customizing Generated Types <a class="header-anchor" href="#updating-and-customizing-generated-types" aria-hidden="true">#</a></h3><p>To <a href="/csharp-add-servicestack-reference.html#dto-customization-options">customize the generated DTO&#39;s</a> on the client you can just uncomment the option you want to change directly in the <strong>header comments</strong> and hit save. <strong>ServiceStackVS</strong> automatically watches for any changes to the generated dto source files (i.e. ending with <code>.dtos.cs</code>) and will automatically send the uncommented options to the remote server referenced by the <code>BaseUrl</code> and replace the existing file with the updated DTOs instantly!</p><p>Taking the example below, once we uncomment the <code>MakePartial</code> option and save the file, <strong>ServiceStackVS</strong> automatically sends a new request to the remote ServiceStack instance, passing in the <code>?MakePartial=False</code> option when requesting updated DTO&#39;s:</p><div class="language-csharp"><pre><code><span class="token comment">/* Options:
Date: 2014-10-21 00:44:24
Version: 1
BaseUrl: http://stackapis.netcore.io

MakePartial: False
//MakeVirtual: True
//MakeDataContractsExtensible: False
//AddReturnMarker: True
//AddDescriptionAsComments: True
//AddDataContractAttributes: False
//AddIndexesToDataMembers: False
//AddResponseStatus: False
//AddImplicitVersion: 
//InitializeCollections: True
//AddDefaultXmlNamespace: http://schemas.servicestack.net/types
*/</span>
</code></pre></div><p>After saving you&#39;ll be able to notice the DTO&#39;s are updated instantly with the <code>Date: *</code> changing to reflect the current time and the new generated DTO&#39;s no longer containing <code>partial</code> classes.</p><h3 id="servicestack-text" tabindex="-1">ServiceStack.Text <a class="header-anchor" href="#servicestack-text" aria-hidden="true">#</a></h3><p>New <code>JsConfig&lt;T&gt;.OnDeserializing</code> and dynamic <code>ShouldSerialize(string field)</code> customization options were added to ServiceStack&#39;s JSON and JSV Text serializers by <a href="https://twitter.com/pavelsavara" target="_blank" rel="noopener noreferrer">@pavelsavara</a>. An example of these new customization options in action is visible below:</p><div class="language-csharp"><pre><code><span class="token punctuation">[</span><span class="token attribute"><span class="token class-name">DataContract</span></span><span class="token punctuation">]</span>
<span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">CustomSerializedPoco</span>
<span class="token punctuation">{</span>
    <span class="token punctuation">[</span><span class="token attribute"><span class="token class-name">IgnoreDataMember</span></span><span class="token punctuation">]</span>
    <span class="token keyword">public</span> <span class="token class-name">HashSet<span class="token punctuation">&lt;</span><span class="token keyword">string</span><span class="token punctuation">&gt;</span></span> hasAttribute<span class="token punctuation">;</span>

    <span class="token punctuation">[</span><span class="token attribute"><span class="token class-name">DataMember</span><span class="token attribute-arguments"><span class="token punctuation">(</span>EmitDefaultValue <span class="token operator">=</span> <span class="token boolean">false</span><span class="token punctuation">,</span> IsRequired <span class="token operator">=</span> <span class="token boolean">false</span><span class="token punctuation">)</span></span></span><span class="token punctuation">]</span>
    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">int</span></span> A <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>

    <span class="token punctuation">[</span><span class="token attribute"><span class="token class-name">DataMember</span><span class="token attribute-arguments"><span class="token punctuation">(</span>EmitDefaultValue <span class="token operator">=</span> <span class="token boolean">false</span><span class="token punctuation">,</span> IsRequired <span class="token operator">=</span> <span class="token boolean">false</span><span class="token punctuation">)</span></span></span><span class="token punctuation">]</span>
    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">int</span><span class="token punctuation">?</span></span> B <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>

    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">bool</span><span class="token punctuation">?</span></span> <span class="token function">ShouldSerialize</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">string</span></span> fieldName<span class="token punctuation">)</span>
    <span class="token punctuation">{</span>
        <span class="token keyword">return</span> hasAttribute <span class="token operator">==</span> <span class="token keyword">null</span> 
            <span class="token punctuation">?</span> <span class="token keyword">null</span>
            <span class="token punctuation">:</span>  hasAttribute<span class="token punctuation">.</span><span class="token function">Contains</span><span class="token punctuation">(</span>fieldName<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>

    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">object</span></span> <span class="token function">OnDeserializing</span><span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">string</span></span> fieldName<span class="token punctuation">,</span> <span class="token class-name"><span class="token keyword">object</span></span> <span class="token keyword">value</span><span class="token punctuation">)</span>
    <span class="token punctuation">{</span>
        <span class="token keyword">if</span> <span class="token punctuation">(</span>hasAttribute <span class="token operator">==</span> <span class="token keyword">null</span><span class="token punctuation">)</span>
            hasAttribute <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">HashSet<span class="token punctuation">&lt;</span><span class="token keyword">string</span><span class="token punctuation">&gt;</span></span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
        hasAttribute<span class="token punctuation">.</span><span class="token function">Add</span><span class="token punctuation">(</span>fieldName<span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token keyword">return</span> <span class="token keyword">value</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre></div><p>This change makes it possible to create dynamic POCO&#39;s that behave in a similar way that dynamic languages can, e.g. After deserialization you can detect which fields were deserialized by inspecting the <code>hasAttribute</code> collection.</p><p>The <code>ShouldSerialize</code> API, closely follows the existing <code>ShouldSerialize{X}</code> convention but instead allows for a single API to handle all serializable properties.</p><p>The API returns a <code>bool?</code> which has the following meaning:</p><ul><li><code>true</code> - Should be emitted</li><li><code>false</code> - Should not be emitted</li><li><code>null</code> - Use default behavior</li></ul><p>This allows us to implement a custom type that can support full round-trip when the field on the original JSON payload allowing use to implement a custom type with similar functionality to <code>IExtensibleDataObject</code> which allows survival and forwarding of unknown properties, but for JSON.</p><h2 id="rabbitmq" tabindex="-1"><a href="/rabbit-mq.html">RabbitMQ</a> <a class="header-anchor" href="#rabbitmq" aria-hidden="true">#</a></h2><p>RabbitMQ Server and Client now have optional <code>PublishMessageFilter</code> and <code>GetMessageFilter</code> callbacks which can be used to intercept outgoing and incoming messages, the <code>IBasicProperties.Type</code> is also pre-populated with the Type name of the message body that was published, e.g:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> mqServer <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RabbitMqServer</span><span class="token punctuation">(</span><span class="token string">&quot;localhost&quot;</span><span class="token punctuation">)</span> 
<span class="token punctuation">{</span>
    PublishMessageFilter <span class="token operator">=</span> <span class="token punctuation">(</span>queueName<span class="token punctuation">,</span> properties<span class="token punctuation">,</span> msg<span class="token punctuation">)</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>
        properties<span class="token punctuation">.</span>AppId <span class="token operator">=</span> <span class="token string">&quot;app:{0}&quot;</span><span class="token punctuation">.</span><span class="token function">Fmt</span><span class="token punctuation">(</span>queueName<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span><span class="token punctuation">,</span>
    GetMessageFilter <span class="token operator">=</span> <span class="token punctuation">(</span>queueName<span class="token punctuation">,</span> basicMsg<span class="token punctuation">)</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>
        <span class="token class-name"><span class="token keyword">var</span></span> props <span class="token operator">=</span> basicMsg<span class="token punctuation">.</span>BasicProperties<span class="token punctuation">;</span>
        receivedMsgType <span class="token operator">=</span> props<span class="token punctuation">.</span>Type<span class="token punctuation">;</span> <span class="token comment">//automatically added by RabbitMqProducer</span>
        receivedMsgApp <span class="token operator">=</span> props<span class="token punctuation">.</span>AppId<span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span><span class="token punctuation">;</span>

<span class="token keyword">using</span> <span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">var</span></span> mqClient <span class="token operator">=</span> mqServer<span class="token punctuation">.</span><span class="token function">CreateMessageQueueClient</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span>
<span class="token punctuation">{</span>
    mqClient<span class="token punctuation">.</span><span class="token function">Publish</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Hello</span> <span class="token punctuation">{</span> Name <span class="token operator">=</span> <span class="token string">&quot;Bugs Bunny&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>

receivedMsgApp<span class="token punctuation">.</span><span class="token function">Print</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>   <span class="token comment">// app:mq:Hello.In</span>
receivedMsgType<span class="token punctuation">.</span><span class="token function">Print</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>  <span class="token comment">// Hello</span>
</code></pre></div><h2 id="other-minor-changes" tabindex="-1">Other Minor Changes <a class="header-anchor" href="#other-minor-changes" aria-hidden="true">#</a></h2><ul><li>ServerEvents Server now echoes heartbeat messages back through to the listening connection, <code>ServerEventsClient</code> only fires the <code>OnHeartbeat</code> callback when it&#39;s receives the echoed <code>cmd.Heartbeat</code> command message</li><li>Request binding for <code>Path</code> and <code>QueryString</code> variables are added to DTO&#39;s with Request DTO&#39;s providing their own <a href="/serialization-deserialization.html">custom body deserialization</a> by implementing <code>IRequiresRequestStream</code></li><li>New <code>IAppHost.OnDisposeCallbacks</code> available allowing <strong>Plugins</strong> to register callbacks when <code>AppHost</code> is disposed</li><li><code>Config.UseHttpsLinks</code> now modifies generated BaseUrl of all links to use <code>https</code></li><li>The <code>ResponseStatus</code> on Custom DTO&#39;s are now preserved when thrown inside a custom <code>HttpError</code> response</li><li>Equality members added to <code>[Route]</code>, <code>[Authenticate]</code>, <code>[RequiredRole]</code> and <code>[RequiredPermission]</code> attributes</li><li><code>ToOptimizedResultUsingCache</code> no longer double-encodes raw <code>string</code> responses</li><li><code>MvcHtmlString</code> was moved to <code>ServiceStack.Html</code> namespace</li><li>New <code>StaticFileHandler.ResponseFilter</code> added to be able to modify custom headers returned on static files</li><li>Many of OrmLite&#39;s static Extension method classes were renamed into a more logical grouping. These changes are source compatible for typical usage of OrmLite API&#39;s, i.e. referenced as extension methods</li></ul><h2 id="breaking-changes" tabindex="-1">Breaking changes <a class="header-anchor" href="#breaking-changes" aria-hidden="true">#</a></h2><h3 id="added-new-net-4-5-builds" tabindex="-1">Added new .NET 4.5 Builds <a class="header-anchor" href="#added-new-net-4-5-builds" aria-hidden="true">#</a></h3><p>In preparation for introducing Async API&#39;s we&#39;ve added new <strong>.NET 4.5 builds</strong> for the following packages:</p><ul><li>ServiceStack.OrmLite</li><li>ServiceStack.OrmLite.Sqlite.Mono</li><li>ServiceStack.OrmLite.SqlServer</li><li>ServiceStack.OrmLite.MySql</li><li>ServiceStack.Server</li></ul><p>When adding ServiceStack NuGet Packages to a <strong>.NET 4.5</strong> project you will now get these newer .NET 4.5 builds instead. The additional builds means you could potentially run into issues if mixing .NET v4.0 and v4.5 builds as all dependencies need to reference the same build version.</p><p>Should you need to, the easiest way to fix any versioning issues is to make sure all projects use the same .NET Framework version (e.g. .NET 4.5) and then just uninstall and re-install the ServiceStack NuGet packages.</p><h3 id="removed-threadstatic-ormlite-configuration" tabindex="-1">Removed ThreadStatic OrmLite Configuration <a class="header-anchor" href="#removed-threadstatic-ormlite-configuration" aria-hidden="true">#</a></h3><p>We&#39;ve also removed our existing ThreadStatic config variables (used to temporarily override global configuration). Most per-connection state is now stored on the connection e.g. <code>CommandTimeout</code> was previously overridden with:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> hold <span class="token operator">=</span> OrmLiteConfig<span class="token punctuation">.</span>TSCommandTimeout<span class="token punctuation">;</span>
<span class="token keyword">try</span> <span class="token punctuation">{</span>
	OrmLiteConfig<span class="token punctuation">.</span>TSCommandTimeout <span class="token operator">=</span> <span class="token number">60</span><span class="token punctuation">;</span>
	db<span class="token punctuation">.</span><span class="token function">Select</span><span class="token punctuation">(</span><span class="token range operator">..</span><span class="token punctuation">.</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span> <span class="token keyword">finally</span> <span class="token punctuation">{</span>
	OrmLiteConfig<span class="token punctuation">.</span>TSCommandTimeout <span class="token operator">=</span> hold<span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre></div><p>Is now set directly on the connection (and only applies to that connection), e.g:</p><div class="language-csharp"><pre><code><span class="token keyword">using</span> <span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">var</span></span> db <span class="token operator">=</span> DbFactory<span class="token punctuation">.</span><span class="token function">Open</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span>
<span class="token punctuation">{</span>
	db<span class="token punctuation">.</span><span class="token function">SetCommandTimeout</span><span class="token punctuation">(</span><span class="token number">60</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
	db<span class="token punctuation">.</span><span class="token function">Select</span><span class="token punctuation">(</span><span class="token range operator">..</span><span class="token punctuation">.</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre></div><p>Likewise if you ever need to access the current <code>OrmLiteConfig.DialectProvider</code>, it should now be retrieved from the <code>IDbConnection</code>, i.e:</p><div class="language-csharp"><pre><code>db<span class="token punctuation">.</span><span class="token function">GetDialectProvider</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>and if you ever need to access the underlying <a href="http://ADO.NET" target="_blank" rel="noopener noreferrer">ADO.NET</a> <code>IDbConnection</code> or <code>IDbCommand</code> you can access them via the following APIs:</p><div class="language-csharp"><pre><code><span class="token class-name">IDbConnection</span> adoDb <span class="token operator">=</span> db<span class="token punctuation">.</span><span class="token function">ToDbConnection</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token class-name">IDbCommand</span> adoDbCmd <span class="token operator">=</span> dmCmd<span class="token punctuation">.</span><span class="token function">ToDbCommand</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><h3 id="ireturnvoid-now-returns-void" tabindex="-1">IReturnVoid now returns void <a class="header-anchor" href="#ireturnvoid-now-returns-void" aria-hidden="true">#</a></h3><p>All <code>IReturnVoid</code> API&#39;s on Service Clients have been changed to return <code>void</code> instead of <code>HttpWebResponse</code> which needed to be explicitly disposed by the callee.</p><p>To access the <code>HttpWebResponse</code>, Request DTO&#39;s can be changed to <code>IReturn&lt;HttpWebResponse&gt;</code></p><div class="language-csharp"><pre><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">EmptyResponse</span> <span class="token punctuation">:</span> <span class="token type-list"><span class="token class-name">IReturn<span class="token punctuation">&lt;</span>HttpWebResponse<span class="token punctuation">&gt;</span></span></span> <span class="token punctuation">{</span> <span class="token range operator">..</span><span class="token punctuation">.</span> <span class="token punctuation">}</span>
</code></pre></div><p>Alternatively the Response can be specified on the call-site with:</p><div class="language-csharp"><pre><code><span class="token class-name">HttpWebResponse</span> response <span class="token operator">=</span> client<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Get</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>HttpWebResponse<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">EmptyResponse</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div>`,116),p=[o];function c(i,l,r,u,k,d){return a(),s("div",null,p)}var g=n(t,[["render",c]]);export{h as __pageData,g as default};
